package app.register.componentsimport androidx.compose.material3.SnackbarHostStateimport androidx.compose.runtime.Composableimport androidx.compose.runtime.rememberimport app.register.RegisterContentimport app.register.RegisterState@Composablefun RegisterScreen() {	val snackbarHostState = remember { SnackbarHostState() }	RegisterContent(		snackbarHostState = snackbarHostState,		state = RegisterState(),		onEmailChange = {},		onPasswordChange = {},		onConfirmPasswordChange = {},		onRegisterClick = {},		onNavigateToLogin = {},		onNavigateToCreateProfile = {}	)}